          <img src={memories} alt="memories" height="60" />
        </AppBar> */}
        <Navbar/>
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/Auth" exact component={Auth} />
        </Switch>
        <Home />
      </Container>
    </BrowserRouter>

  );


export default App;
